    const [reviews, setReviews] = useState([])
    const [form, setForm] = useState({company: "", review: "", id: uuidv4()});
  return (
    <div className='googleForm'>
        <h1>Amazon Interview Feedback</h1>
        <ReviewList reviews = {reviews} setReviews = {setReviews}/>
    </div>
  )
}

